@media screen and (max-width: 750px) {
  #main { padding: 20px; min-width: inherit; }
  #main #content { padding: 0px; border: none; width: 100% !important; }
  #banner-content { max-width: 70vw; }
  #menu { text-align: left; }
  :root { --white: #f9f9f9; --black: #000; --gray: #85888C; --green: #b6d7a8; color-scheme: light dark; }
  .nav { width: 15rem; height: 100%; max-height: 0px; position: fixed; top: 50px; right: 0px; border-left: 1px solid rgb(144, 144, 144); background-color: var(--white); overflow: hidden; transition: 0.5s ease-in-out; }
  .nav ul { margin: 0px; padding: 20px; }
  .nav h1 { padding: 0px 20px; }
  .nav ul li { list-style-type: none; padding: 0px; margin: 0px; }
  .hamb { cursor: pointer; float: right; position: absolute; top: 0px; right: 0.25em; width: 3.5em; padding-top: 1.5em; z-index: 1100; }
  .hamb-line { background: var(--green); display: block; position: relative; height: 0.3em; width: 2.75em; border-radius: 3px; }
  .hamb-line::before, .hamb-line::after { background: var(--green); content: ""; display: block; height: 100%; position: absolute; transition: 0.2s ease-in-out; width: 100%; border-radius: 3px; }
  .hamb-line::before { top: 10px; }
  .hamb-line::after { top: -10px; }
  .side-menu { display: none; }
  .side-menu:checked ~ .nav { max-height: 100%; top: 50px; }
  .side-menu:checked ~ .hamb .hamb-line { background: transparent; }
  .side-menu:checked ~ .hamb .hamb-line::before { transform: rotate(-45deg); top: 0px; }
  .side-menu:checked ~ .hamb .hamb-line::after { transform: rotate(45deg); top: 0px; }
  code { white-space: pre-line; }...

@media (prefers-color-scheme: dark) {
  body { background-color: rgb(28, 38, 45); color: rgb(238, 238, 238); }
  h1, h2, h3, h4, h5, h6, p { color: rgb(238, 238, 238); }
  a { color: rgb(85, 164, 241); text-decoration: underline; }
  a:visited { color: rgb(139, 121, 192) !important; }
  .nav { background: var(--black); }
  #menu a { color: rgb(85, 164, 241); }
  blockquote pre { border: 1px solid rgb(19, 34, 53); color: rgb(221, 221, 221) !important; background: rgb(15, 27, 41) !important; }
  div.directive { background: rgb(12, 22, 34) !important; border-top: 2px solid rgb(32, 60, 94) !important; }
  code { background: rgb(12, 22, 34); color: rgb(221, 221, 221) !important; }
  .lightimage { display: none !important; }
  .darkimageWrapper, .darkimage { display: block !important; }
  .dropbtn { background-color: rgb(32, 32, 32); }
  .dropdown-content { background-color: rgb(64, 64, 64); box-shadow: rgb(16, 16, 16) 0px 8px 12px 0px; }
  .dropdown-content a:hover { background-color: rgb(36, 36, 36); }
  .dropdown:hover .dropbtn { background-color: rgb(32, 32, 32); }
}
